if version == 11:
    content_bindings = [tm11.ContentBinding(b) for b in bindings]
    if subscription_id:
        poll_parameters = None
    else:
        poll_parameters = tm11.PollParameters(response_type=RT_FULL,
            content_bindings=content_bindings)
    return tm11.PollRequest(message_id=MESSAGE_ID, collection_name=
        collection_name, subscription_id=subscription_id, poll_parameters=
        poll_parameters)
elif version == 10:
    content_bindings = bindings
    return tm10.PollRequest(message_id=MESSAGE_ID, feed_name=
        collection_name, content_bindings=content_bindings, subscription_id
        =subscription_id)
